// must be imported first to set env variables
import './scripts/set-env';

import { build } from 'vite';
import * as configs from './vite.configs';
import { mkdir } from 'fs/promises';
import { getBrowser, isDev, releaseTarget, releaseType } from './scripts/util';
import colorLog from 'scripts/log';
import { exec } from 'child_process';
import { emptydirSync } from 'fs-extra';
import createDistributable from 'scripts/create-distributable';

/**
 * Try to make a directory, dont error if the directory exists
 *
 * @param str - path to directory to try to make
 */
async function trymkdir(str: string) {
	try {
		await mkdir(str);
	} catch (err) {
		if (
			!err ||
			typeof err !== 'object' ||
			!('code' in err) ||
			err.code !== 'EEXIST'
		) {
			throw new Error('Something went wrong making build folder');
		}
	}
}

async function main() {
	await trymkdir('build');
	const folder = `build/${getBrowser()}`;
	await trymkdir(folder);
	emptydirSync(folder);

	const scripts = [
		build(configs.buildStart),
		build(configs.buildBackground),
		build(configs.buildContent),
	];
	await Promise.all(scripts);

	if (isDev() && releaseTarget === 'safari') {
		await new Promise((resolve) => {
			setTimeout(resolve, 10000);
		});
	}

	if (releaseTarget === 'safari' && !isDev()) {
		colorLog('Compiling safari extension', 'info');
		await new Promise<void>((resolve, reject) => {
			exec('bash safari.sh', (err, stdout, stderr) => {
				if (err) {
					colorLog(err, 'error');
					colorLog(stdout, 'info');
					colorLog(stderr, 'error');
					reject(new Error());
					return;
				}
				colorLog('Successfully compiled safari extension', 'success');
				resolve();
			});
		});
	}

	if (releaseType === 'dist') {
		await createDistributable();
	}
}

main();

import type { Manifest } from 'webextension-polyfill';
import pkg from './package.json';
import { releaseTarget } from './scripts/util';

/**
 * Common properties between all browsers manifests
 */
export const common: Manifest.WebExtensionManifest = {
	manifest_version: 3,
	name: 'Web Scrobbler',
	default_locale: 'en',
	description: '__MSG_extDescription__',
	version: pkg.version,

	permissions: ['storage', 'contextMenus', 'notifications', 'scripting'],
	host_permissions: ['http://*/', 'https://*/'],

	content_scripts: [
		{
			matches: ['<all_urls>'],
			js: ['content/main.js'],
			all_frames: true,
		},
	],

	web_accessible_resources: [
		{
			resources: ['connectors/*'],
			matches: ['<all_urls>'],
		},
		{
			resources: ['icons/*'],
			matches: ['<all_urls>'],
		},
	],

	options_ui: {
		page: 'src/ui/options/index.html',
		open_in_tab: true,
	},

	icons: {
		16: 'icons/icon_main_16.png',
		48: 'icons/icon_main_48.png',
		96: 'icons/icon_main_96.png',
		128: 'icons/icon_main_128.png',
		256: 'icons/icon_main_256.png',
		512: 'icons/icon_main_512.png',
	},

	action: getAction(releaseTarget),

	commands: {
		'toggle-connector': {
			description: '__MSG_hotkeyToggleConnector__',
		},
		'love-song': {
			description: '__MSG_hotkeyLoveSong__',
		},
		'unlove-song': {
			description: '__MSG_hotkeyUnloveSong__',
		},
	},
};

/**
 * Manifest for chromium browsers
 */
export const chromeManifest: Manifest.WebExtensionManifest = {
	...common,
	background: {
		service_worker: 'background/main.js',
	},
};

/**
 * Manifest for safari
 */
export const safariManifest: Manifest.WebExtensionManifest = {
	...common,
	background: {
		scripts: ['background/main.js'],
		persistent: false,
	},
};

/**
 * Manifest for firefox
 */
export const firefoxManifest: Manifest.WebExtensionManifest = {
	...common,
	background: {
		scripts: ['background/main.js'],
	},

	browser_specific_settings: {
		gecko: {
			id: '{799c0914-748b-41df-a25c-22d008f9e83f}',
		},
	},
};

/**
 * Gets action with defaults for a browser
 *
 * @param browser - browser to get action for
 * @returns manifest action object
 */
function getAction(browser?: string) {
	// default to light theme in browsers that have themed icon as we cannot dynamically set in manifest.
	const defaultType = browser === 'safari' ? 'safari' : 'light';
	return {
		default_icon: {
			16: `icons/action_unsupported_16_${defaultType}.png`,
			19: `icons/action_unsupported_19_${defaultType}.png`,
			32: `icons/action_unsupported_32_${defaultType}.png`,
			38: `icons/action_unsupported_38_${defaultType}.png`,
		},
		default_title: '__MSG_pageActionUnsupported__',
		default_popup: 'src/ui/popup/index.html',
	};
}

